import '../styles/socials.css';

function Socials() {
  return (
    <section className="socials-section">
      <h2 className="socials-title">Socials <span className="at-icon">@</span></h2>
      <div className="socials-grid">
        <a className="social-box linkedin" href="https://linkedin.com/in/poncho-ajmv" target="_blank" rel="noreferrer">
          <img src="https://cdn-icons-png.flaticon.com/512/174/174857.png" alt="LinkedIn" className="icon" /> Linkedin
        </a>
        <a className="social-box github" href="https://github.com/poncho-ajmv" target="_blank" rel="noreferrer">
          <img src="https://cdn-icons-png.flaticon.com/512/25/25231.png" alt="GitHub" className="icon" /> Github
        </a>
        <a className="social-box discord" href="https://discord.com/users/957722095381540874" target="_blank" rel="noreferrer">
          <img src="https://cdn-icons-png.flaticon.com/512/2111/2111370.png" alt="Discord" className="icon" /> Discord
        </a>
      </div>
    </section>
  );
}

export default Socials;
